const title = 'Shahryar Rajabpoor';
const description = 'Front-end Developer, JavaScript enthusiast.';

const SEO = {
  title,
  description,
  canonical: 'https://jshead.dev',
  openGraph: {
    type: 'website',
    locale: 'en_IE',
    url: 'https://jshead.dev',
    title,
    description
  }
};

export default SEO;
